export function symbolsListToMultiSelectOption(arr){
    let output = [];
    for(let i =0; i<arr.length;++i){
      output.push({label: arr[i], value:arr[i]});
    }
    return output;
  }

 export function multiSelectOptionToSymbolsList(arr){
    let output = [];
    for(let i =0; i<arr.length;++i){
      output.push(arr[i].value);
    }
    return output;
  }
